        setartData(res.data)
        console.log(artData);
      });
    },[]);

  return (

    <div className="container mt-5 d-flex flex-column">    
         {artData.map((data, key) => {
                return <FeatureList imgAddress={data.imagePath}  title={data.title} description={data.description} artistname={"data"}/>;
            })} 
    </div>
  )
}

export default SearchList
